import React from 'react';
import './App.css';
import Layout from './Layout/Layout';
import {
    BrowserRouter as Router, Route, Switch,
  } from "react-router-dom";
import { PostcodeForm } from './pages/Form/PostcodeForm';
import { DataBuilder } from './pages/DataBuilder/DataBuilder';

interface RouteProps {
    path: string;
    children: React.ReactElement;
}  
const AppRoute = (props: RouteProps) => {
    return  (
      <Route
        exact
        path={props.path}
        render={(routeProps) =>
          React.cloneElement(props.children, { ...routeProps })
        }
      />
    ) 
};
function App() {
    return (
        <Router>  
            <Switch>
            <AppRoute path="/">
                <Layout>
                    <PostcodeForm />
                </Layout>
            </AppRoute>
            <AppRoute path="/:id">
                <Layout>
                    <DataBuilder/>
                </Layout>
            </AppRoute>

            </Switch>
        </Router>
    );
}
 //render={(props) => (<Component {...props} />)
export default App;
